import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ItemSearch from "./itemSearch";

const Business = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/itemSearch">
          <ItemSearch />
        </Route>
      </Switch>
    </Router>
  );
};

export default Business;
